import React from 'react';

class KidneyDisease extends React.Component {

    postData = async (url = '', data = {}) => {
          const response = await fetch(url, {
            method: 'POST',
            mode: 'cors',
            cache: 'no-cache',
            credentials: 'same-origin',
            headers: {
                'Content-Type': 'application/json',
            },
            redirect: 'follow',
            referrer: 'no-referrer',
            body: JSON.stringify(data),
        });
        return await response.json();
      }

    render() {

        // this.postData(`${process.env.REACT_APP_API_URL}/kidneydisease`, "OK")
        this.postData(`${process.env.REACT_APP_API_URL}/kidneydisease`, ["OK"])
        // this.postData(`${process.env.REACT_APP_API_URL}/kidneydisease`, [] )

        // this.postData(`${process.env.REACT_APP_API_URL}/kidneydisease`, { efgrList: [
        //     { efgr: 65, atDate: Date.now() },
        //     { efgr: 70, atDate: Date.now() },
        // ]})
        // .then(data => console.log(data))
        // .catch(error => console.error(error));

        return <div></div>
    }
}

export default KidneyDisease;
